import React from 'react';
import Grid from '@material-ui/core/Grid';
import Card from 'react-bootstrap/Card';
import List from '@material-ui/core/List';
import ListItem from '@material-ui/core/ListItem';
import ListItemText from '@material-ui/core/ListItemText';
import Paper from '@material-ui/core/Paper';
import Typography from '@material-ui/core/Typography';
import Styles from '../../Styles/ULView/';

export default class ULView extends React.Component {

    render() {
        const { data, lng, lngTranslations } = this.props;
        const Translations = lngTranslations[this.constructor.name];
        return(
            <Grid
                container
                justify="center"
                style={Styles.mainRow}
            >
                <Grid item xs sm md lg>
                    <Card
                        bg="light"
                        key="1"
                        text="dark"
                    >
                        <Card.Header style={Styles.cardHeader}>
                            {Translations[data.title]}
                        </Card.Header>
                        <Card.Body style={Styles.cardBody}>


                            <Paper
                                elevation={3}
                                style={{
                                    padding: "1em"
                                }}
                            >
                                <Typography style={{
                                    textAlign: "left",
                                    padding: "1em",
                                    borderBottom: "1px solid black"
                                }}>
                                    Hello world
                                </Typography>
                                <Typography style={{
                                    textAlign: "left",
                                    padding: "1em",
                                    borderLeft  : "1px solid black"
                                }}>
                                    Hello world 2
                                </Typography>
                            </Paper>


                        </Card.Body>
                    </Card>
                </Grid>
            </Grid>
        )
    }

}
